ISLAMABAD, June 29 (APP): Minister for Information Technology Syed Amin-ul-Haq and Member of the National Assembly (MNA) Khalid Maqbool Siddiqui called on Prime Minister Imran Khan here on Tuesday.
Progress of the ongoing projects under the Ministry of Information Technology and the government’s measures to enhance the country’s IT sector exports were discussed in the meeting.
